"93736":{"id":"93736","name":"A Guerra dos Samurais","slug":"a-guerra-dos-samurais","original_title":"Age of Samurai: Battle for Japan","overview":"Reconstituições e comentários de especialistas dão vida à história conturbada e às lutas por poder no Japão feudal do século 16.","first_air_date":"2021-02-24","episode_run_time":45,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Cream Productions"],"genres":["Documentário","War & Politics"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/ooq4qnr6ZCcc7ziJMOw6LTtMyoO.jpg","poster_path":"https://image.tmdb.org/t/p/original/h1kkluX8eQdJlx9VKxhU4oMkJRO.jpg","cast":["Elijah Bender","David Spafford","Nathan Ledbetter","David Eason","Oleg Benesch"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/l4vdpiwwWSCb6E9TBXwJWoBw1tX.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/l4vdpiwwWSCb6E9TBXwJWoBw1tX.jpg","air_date":"2021-02-24","episode_count":6,"overview":"N/A","vote_average":7.1,"episodes":{"1":{"name":"A ascensão de Nobunaga","overview":"Considerado um tolo e incapaz de governar, Nobunaga sobe ao poder como líder do clã Oda, causando discórdia entre seus familiares que também querem o poder.","air_date":"2021-02-24","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/5ADq3wB7dceew5rvhnkwMPDjH6c.jpg","vote_average":7.25},"2":{"name":"Em busca de poder","overview":"Nobunaga enfurece os guerreiros ao conquistar a maior parte do Japão central e inicia uma guerra violenta contra o daimiô Takeda Shingen.","air_date":"2021-02-24","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/qMG0GzGMzDVIaPpbBmMtcmR43r1.jpg","vote_average":7.4},"3":{"name":"O Rei-Demônio","overview":"Nobunaga fica cada vez mais ambicioso e alguns generais questionam sua liderança. Isso leva a uma traição que muda o cenário político do Japão para sempre.","air_date":"2021-02-24","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/jd74y5VtHZib7NwV5uovqLJpZvd.jpg","vote_average":7.222},"4":{"name":"Controle total","overview":"Toyotomi Hideyoshi assume como líder. Ainda assim, Date Masamune, um jovem daimiô do norte, ignora as ordens dele.","air_date":"2021-02-24","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/4uCe2PqH16uhZiFrQRGqd8D2Ijg.jpg","vote_average":6.875},"5":{"name":"Catástrofe","overview":"Com o país unificado, Hideyoshi planeja estender o reino até a China. Alguns desafios logísticos e a oposição ferrenha na Coreia causam estragos.","air_date":"2021-02-24","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/we1e1Q5OnLQlNl3v18WRRAR3SNd.jpg","vote_average":7},"6":{"name":"Nasce uma dinastia","overview":"À beira da morte, Hideyoshi aponta cinco regentes para governar até que o filho tenha idade para assumir o poder, mas Tokugawa Ieyasu declara guerra contra os oponentes.","air_date":"2021-02-24","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/1A0zSUMbnVoYeN8WwrFhciexaka.jpg","vote_average":7}}}}},
