"71181":{"id":"71181","name":"Troia: A Queda de Uma Cidade","slug":"troia-a-queda-de-uma-cidade","original_title":"Troy: Fall of a City","overview":"Em busca da mulher prometida por Afrodite, o pastor Páris descobre sua verdadeira identidade e se apaixona por Helena de Esparta, desencadeando a Guerra de Troia.","first_air_date":"2018-02-17","episode_run_time":56,"vote_average":5.888,"number_of_seasons":1,"number_of_episodes":8,"created_by":["David Farr"],"production_companies":["Wild Mercury Productions","Kudos"],"genres":["War & Politics","Drama","Action & Adventure"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/3zzAYFF57wqNbwDqtByMHi85HkH.jpg","poster_path":"https://image.tmdb.org/t/p/original/7RPWQw4YfKQHFwnJXi7ZdfoE5vZ.jpg","cast":["Louis Hunter","Bella Dayne","David Threlfall","Frances O'Connor","Tom Weston-Jones"],"trailer":"sF2I8tODDMk","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wPLiUBrVav1ssvRwcr0M3Xq92Vi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wPLiUBrVav1ssvRwcr0M3Xq92Vi.jpg","air_date":"2018-02-17","episode_count":8,"overview":"Em busca da mulher prometida por Afrodite, o pastor Páris descobre sua verdadeira identidade e se apaixona por Helena de Esparta, desencadeando a Guerra de Troia.","vote_average":4.9,"episodes":{"1":{"name":"Sangue negro","overview":"Um encontro divino leva o jovem e belo pastor Páris a uma trágica jornada rumo aos jogos da cidade de Troia. Lá, uma verdade surpreendente o aguarda.","air_date":"2018-02-17","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/qclF5f46uRXhVIdoVBVXncB1cLS.jpg","vote_average":5.1},"2":{"name":"Condições","overview":"Quando o caso amoroso se torna público, os gregos reúnem um exército contra Troia. Mas Ártemis exige um grande sacrifício para permitir a viagem.","air_date":"2018-02-24","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/18WvVSgVf5CWVklsEWGB4BZRcS8.jpg","vote_average":3.2},"3":{"name":"Encurralados","overview":"Na esperança de obter alimentos e provisões de seu influente sogro, Heitor empreende uma jornada arriscada à Cilícia, tendo Páris como companheiro.","air_date":"2018-03-03","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/gPHqmiXjhp1NXevWhcfMZ4ZmHYf.jpg","vote_average":5},"4":{"name":"Espólio da guerra","overview":"O descuido de Helena em seu encontro com Aquiles tem consequências devastadoras. O rei Agamenon escolhe a mulher errada como brinquedo.","air_date":"2018-03-10","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/ppWvAQLlcpnylQ9bmVlPdU2CD0C.jpg","vote_average":5},"5":{"name":"Perseguição","overview":"Páris foge. Pândaro investiga o desaparecimento da criada de Helena. Um espião troiano descobre que os soldados gregos não contam mais com Aquiles e seus homens.","air_date":"2018-03-17","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/yBjpjuoNuCackWcf8QFfBaxtwZw.jpg","vote_average":5},"6":{"name":"Batalha na praia","overview":"As amazonas encontram Páris, que descobre ter um inimigo em comum com elas. Afrodite envia uma mensagem. Os gregos provam do próprio veneno.","air_date":"2018-03-24","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/eJWWBGLgdpmBGfauF13g33unE4O.jpg","vote_average":5.2},"7":{"name":"Doze dias","overview":"Os troianos descobrem um espião grego infiltrado, e o segredo de Helena pode vir à tona. Os gregos conseguem convencer Aquiles a voltar à luta.","air_date":"2018-03-31","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/nKEiToaX479G4ydRXQOREpYLomU.jpg","vote_average":5.2},"8":{"name":"Oferta","overview":"Numa missão para planejar a próxima ofensiva, os troianos chegam a uma praia e tomam uma decisão que selará seu destino.","air_date":"2018-04-07","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/uWHrWda2CaSIHxyz49TCpUMgtEG.jpg","vote_average":5.2}}}}},
