"94167":{"id":"94167","name":"El Cid","slug":"el-cid","original_title":"El Cid","overview":"Lá pelo ano 1000, a Espanha é dominada pelos mouros, e a esperança está toda com El Cid. Um cavaleiro heroico e nobre espanhol que sabe que uma nação dividida não pode vencer e que a luta não é só contra os invasores, mas também para unir seu povo.","first_air_date":"2020-12-18","episode_run_time":59,"vote_average":7.3,"number_of_seasons":2,"number_of_episodes":10,"created_by":["José Velasco","Luis Arranz"],"production_companies":["Zebra Producciones"],"genres":["Action & Adventure","Drama","War & Politics"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/iyxHHqI6n6I89t6QBOMeGxVm18v.jpg","poster_path":"https://image.tmdb.org/t/p/original/qgKB7PgoAIUXNAs8xr4OjThgp4C.jpg","cast":["Jaime Lorente","Francisco Ortiz","Alicia Sanz","Jaime Olías","Lucía Guerrero"],"trailer":"OZ4tqeREbYE","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/eNmtSyKksleNP9osXkVRR4mLb2z.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/eNmtSyKksleNP9osXkVRR4mLb2z.jpg","air_date":"2020-12-18","episode_count":5,"overview":"Ruy Díaz de Vivar é um jovem pajem que serve lealmente ao seu mestre, Sancho, o futuro Rei de Castela e Leão. Enquanto luta para ganhar destaque na corte usando seu talento natural com a espada, ele acaba por descobrir uma conspiração para derrubar o Rei, o que causaria derramamento de sangue, dor e morte tanto nos reinos cristãos quanto nas taifas muçulmanas.","vote_average":4.2,"episodes":{"1":{"name":"A CONSPIRAÇÃO","overview":"Meados do século XI. Ruy é um jovem que acaba de ser nomeado escudeiro do príncipe Sancho, filho mais velho do rei Fernando de Leão. Uma noite, ele descobre que alguém que ama está envolvido em uma conspiração para derrubar o Rei. A partir de então, Ruy se questiona se deve priorizar a lealdade à coroa ou o amor pela família.","air_date":"2020-12-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/w5ea2kWu6s3Nm2lw5BvJJ3t3kDY.jpg","vote_average":3.7},"2":{"name":"PROVAÇÃO","overview":"Flaín quer descobrir quem foi o responsável por acabar com o plano de conspiração. Rodrigo sabe que foi seu neto e, por isso, decide mandá-lo de volta para Vivar. Ruy se recusa a sair de perto do rei e deixá-lo a mercê de Flaín. A única solução é pôr fim à vida do conde de Leão. Quando todos estão prestes a ser desmascarados, as tropas de Navarra aparecem na fronteira e declaram guerra a Leão.","air_date":"2020-12-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/bYhqPbXDUPqtha9LZJUndqkyLFf.jpg","vote_average":4.2},"3":{"name":"BARAKA","overview":"Fernando envia seu filho Sancho para Saragoça, acompanhado de um pequeno exército. O intuito é que Sancho enfrente o tio, Ramiro, Rei de Aragão. Antes de partir com Sancho, Ruy revela ao Rei que Flaín tentou matá-lo. Fernando começa a investigar quem o traiu. Ruy deixa Leão sem saber que Flaín enviou um assassino infiltrado para matá-lo.","air_date":"2020-12-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/lMC6IgzdXTHO2QPLiEXvr0K2zgi.jpg","vote_average":4.1},"4":{"name":"CAMPEÃO","overview":"Em menor número, as tropas de Castela, com Sancho e Ruy, enfrentam uma batalha contra os aragoneses. Quando tudo parece perdido, uma reviravolta muda o destino de todos. Em Leão, Fernando descobre que sua esposa, Sancha, estava entre os traidores da coroa. Sem que o Rei saiba, Urraca toma uma decisão que mudará para sempre a distribuição de poder do reino.","air_date":"2020-12-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/MvPOmpHgUi809SrNaCvwdSXENw.jpg","vote_average":4.3},"5":{"name":"EXPIAÇÃO","overview":"Após receberem a notícia sobre a doença de Fernando, Sancho e suas tropas voltam para Leão. Ruy conta ao avô que Flaín enviou alguém para matá-lo. Rodrigo sabe que a vida de seu neto está em perigo. Flaín não desiste de seu plano para derrubada do rei e decide tentar tomar o poder antes mesmo de sua morte. Ele não sabe que a Urraca ainda tem uma carta na manga.","air_date":"2020-12-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/vfxtVsckC3wbiR6JAQ5yodPswEy.jpg","vote_average":4.6}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/qgKB7PgoAIUXNAs8xr4OjThgp4C.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qgKB7PgoAIUXNAs8xr4OjThgp4C.jpg","air_date":"2021-07-15","episode_count":5,"overview":"Após a morte do pai, Sancho, Alfonso e Garcia se tornam reis de Castela, Leão e Galícia, respectivamente. As disputas entre eles transformarão a Península Ibérica em um campo de batalha. Ruy é nomeado cavaleiro e se aproxima de realizar o sonho de seu pai. Mas, nesse ínterim, ele terá de sacrificar o que mais ama.","vote_average":5.6,"episodes":{"1":{"name":"Promessas e Tentações","overview":"Após o assassinato de Flaín, o Conde de Leão, muitos apontam Ruy como o culpado. Enquanto isso, o guerreiro de Vivar é forçado a voltar a Saragoça, onde foi sentenciado à morte por se deitar com Amina, a filha do Emir. Em Leão, Urraca descobre que Jimena e Ruy se amam e arquiteta um plano para se beneficiar dessa informação.","air_date":"2021-07-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/6zXMBqOHsIEpKAZNS7vblFNdV2d.jpg","vote_average":6},"2":{"name":"O Peso do Dever","overview":"Alfonso, seguindo o conselho de Urraca, usa uma última carta na manga para tentar fazer com que Ruy fique em Leão: ele se propõe a romper o compromisso de Jimena com Orduño e abençoar o casamento dela com Ruy. Ruy pode ter tudo que quer, mas, em troca, terá de trair Sancho. Na tentativa de desestabilizar os reinos cristãos, os mouros contam a Sancha que o rei foi envenenado.","air_date":"2021-07-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/arDwwKmXYcC7fIsPTthOiMT5wSy.jpg","vote_average":5.8},"3":{"name":"Vento de Guerra","overview":"Após a morte de Sancha, a guerra entre os três irmãos fica iminente. Sancho se prepara para atacar a Galícia, mas, para isso, precisa cruzar Leão. Alfonso não sabe se aproveita o momento para atacá-lo ou se o deixa passar. Ruy sofre para lidar com a paixão que há entre ele e Amina e a dor provocada pelo compromisso entre Jimena e Orduño.","air_date":"2021-07-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/78c5FhnN4hi0BXUau2gYWYEchoq.jpg","vote_average":5},"4":{"name":"Episódio 4","overview":"Após a intervenção decisiva de Ruy na batalha, Sancho de Castela toma a Galícia de seu irmão, Garcia. Mas isso não traz paz à Península Ibérica, pelo contrário, atiça os ânimos para a iminente batalha entre Leão e Castela. Ruy é forçado a trair Amina.","air_date":"2021-07-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/s6nUXLRqGn67MKWnVuZtLzDfoiN.jpg","vote_average":5},"5":{"name":"O Caminho do Ódio","overview":"Sancho decide executar o irmão, Alfonso, para que os nobres de Leão, entre eles Orduño, o apoiem. Sancho pretende ser coroado Rei de Leão após a morte do irmão e propõe a Ruy, como recompensa por seus serviços, que ele se torne o novo Conde após a morte de Orduño. Ele finalmente poderá ter tudo que sempre sonhou: nobreza, terras... e Jimena. Mas Ruy não sabia o que estava por vir.","air_date":"2021-07-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/6dkIvcgnMGBmSrAHBtSQ238ioCQ.jpg","vote_average":6}}}}},
