"221871":{"id":"221871","name":"O Grifo","slug":"o-grifo","original_title":"Der Greif","overview":"O Grifo é criatura sombria poderosa de outro mundo e uma ameaça para Mark e tudo o que ele ama. Mark deve aceitar o difícil legado de sua família e lutar para salvar nosso mundo das garras do Grifo.","first_air_date":"2023-05-26","episode_run_time":0,"vote_average":6.8,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Sebastian Marka","Erol Yesilkaya"],"production_companies":["Wiedemann & Berg Television","Amazon Studios"],"genres":["Sci-Fi & Fantasy","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/nwSDpjQQI4lHe6Y5iz3CLW6r8GW.jpg","poster_path":"https://image.tmdb.org/t/p/original/yzDz44EvpoM83yTqOSURRaXKuab.jpg","cast":["Jeremias Meyer","Zoran Pingel","Lea Drinda","Sabine Timoteo","Flora Thiemann"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/yzDz44EvpoM83yTqOSURRaXKuab.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/yzDz44EvpoM83yTqOSURRaXKuab.jpg","air_date":"2023-05-26","episode_count":6,"overview":"N/A","vote_average":6.9,"episodes":{"1":{"name":"Contra Tempos Ruins","overview":"No dia do aniversário de 16 anos de Mark, seu irmão, Thomas, revela o sombrio segredo de família e o entrega a Crônica da Torre Negra, um relato sobre um mundo diferente governado por uma criatura misteriosa - o Grifo. Mas o que essa crônica tem a ver com a morte do pai deles?","air_date":"2023-05-26","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/hCuEAs68EuvItzDVFg2FM0q2NCQ.jpg","vote_average":6.6},"2":{"name":"Não é Responsabilidade Minha","overview":"Com a ajuda de Memo, Mark relutantemente sai em busca do irmão, Thomas, que desapareceu no mundo da Torre Negra. Enquanto isso, Becky pesquisa sobre o passado de Mark e descobre um terrível segredo.","air_date":"2023-05-26","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/tQFVP5Erlr2HNwsu3Wt7SV7Y9Eq.jpg","vote_average":7},"3":{"name":"Maldito Super-Herói","overview":"Contra os desejos da mãe, Mark tenta encontrar um caminho de volta para o mundo da Torre Negra para salvar Memo. Enquanto isso, Becky tenta descobrir se aquilo que está escrito na Crônica existe mesmo ou se Mark está sofrendo com alucinações.","air_date":"2023-05-26","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/jKhwDDKcyRC5vjxNfETlzrB2h8l.jpg","vote_average":7},"4":{"name":"Molezinha","overview":"Mark e Memo bolam um plano para libertar Thomas. Becky não desconfia de nada. Ela está convencida de que Mark está imaginando coisas como a mãe dele, que quer interná-lo em um hospital psiquiátrico. Será que Mark conseguirá escapar?","air_date":"2023-05-26","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/pZ9wSrULtmyQK2PqIHiCvxbKyHd.jpg","vote_average":7.2},"5":{"name":"Ele Está Pronto","overview":"Enquanto Mark e Memo se preparam para a chegada dos Tauros, Becky tenta convencer a mãe de Mark que ele não está alucinando. Mas é aí que acontece uma reviravolta do destino...","air_date":"2023-05-26","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/fQWbmvcLd2sh9z07umZNSUsWXAw.jpg","vote_average":7},"6":{"name":"Sinta o Ódio!","overview":"A mãe de Mark recebe uma informação chocante de Bräker sobre a morte do marido. Mark e Memo encaram o último horror no mundo da Torre Negra.","air_date":"2023-05-26","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/n6OyfKb8Er9rhgDPOiEuaxu3Y81.jpg","vote_average":6.5}}}}},
